window.bookSummaryJSON = "<p>Earth burns. </p> <p>We call them the scum. They came from deep space. Creatures of claws and endless malice, they ravage the world. </p> <p>As the war flares, as cities crumble, Private Marco Emery and his platoon blast into space. They won one battle on Earth. Their next battle must be fought in the darkness. </p> <p>The scum will not rest until the last human is dead. Marco and his friends must defeat them. They must win. Or Earth will fall. </p>"; 
